.btn {
  display: inline-block;
  text-decoration: none;
  cursor: pointer;
  border: 0;
  background-image: linear-gradient(to right, hsl(136, 65%, 51%), hsl(192, 70%, 51%));
  position: relative;
  font-size: 0.825rem;
  font-weight: 700;
  text-transform: capitalize;
  padding: 1em 2em;
  border-radius: 1.5em;
  color: hsl(0, 0%, 100%);
}
.btn:hover::before {
  content: "";
  position: absolute;
  inset: 0;
  height: 100%;
  width: 100%;
  background-color: rgba(255, 255, 255, 0.4);
}

.even-col {
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
}

.even-col > * {
  flex: 1;
}

.flex {
  display: flex;
