}
.flex.al-sa {
  justify-content: space-around;
}

.nav {
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.nav .brand-title {
  font-size: --fs-600;
}

.primary-navigation {
  display: flex;
  gap: 1rem;
  justify-content: space-around;
  align-items: center;
  padding-block: 2.125em;
}

.nav__link {
  position: relative;
}

.nav__link:hover::after,
.nav__link:focus::after {
  content: "";
  position: absolute;
  bottom: -2.125em;
  left: 0;
  height: 0.2rem;
  width: 100%;
  background: linear-gradient(to right, hsl(136, 65%, 51%), hsl(192, 70%, 51%));
}

.mobile-nav-toggle {
  display: none;
}

@media (max-width: 48rem) {
  .primary-header .btn {
    display: none;
  }
  .nav__link:hover::after,
  .nav__link:focus::after {
    display: none;
  }
  .primary-header {
    padding-block: 1.25rem;
  }
  .primary-navigation {
    flex-direction: column;
    gap: 1.5rem;
    justify-content: center;
    align-items: center;
    padding-block: 2.125rem;
    width: 80vw;
    margin-top: 1rem;
    border-radius: 5px;
    position: fixed;
    background-color: hsl(0, 0%, 100%);
    right: 10vw;
    left: 10vw;
    top: 4.25rem;
    z-index: 1000;
    transform: translateX(calc(100% + 10vw));
    transition: transform 500ms ease-in-out;
  }
  .primary-navigation.visible {
    transform: translateX(0);
  }
  .mobile-nav-toggle {
    display: block;
    background-image: url("/8478c65064679a74b4889d468b235634.svg");
    background-repeat: no-repeat;
    background-position: center;
    width: 1.5rem;
    aspect-ratio: 1;
    border: none;
    background-color: transparent;
    order: 1;
    cursor: pointer;
  }
  .mobile-nav-toggle.visible {
    background-image: url("/160a364c927ad59fcb60df230093b7d5.svg");
  }
  header.overlay {
    position: relative;
    z-index: 2;
  }
  header.overlay::after {
    content: "";
    position: absolute;
    width: 100vh;
    height: 100vh;
    background: linear-gradient(to bottom, hsl(233, 26%, 24%), transparent);
    z-index: 1;
  }
}
.tab-list {
  --gap: 2rem;
}

.numbered-list {
  display: flex;
  justify-content: center;
  align-items: center;
}

