@use 'abstracts' as *;
@use 'utilities' as *;
@use 'layout' as *;

.nav {
  @include flex;
  justify-content: space-between;
  align-items: center;

  .brand-title {
    font-size: $fs-brand-title;
  }
}

.primary-navigation {
  @include flex;
  gap: 1rem;
  justify-content: space-around;
  align-items: center;
  padding-block: 2.125em;
}

.nav__link {
  position: relative;
}
.nav__link:hover::after,
.nav__link:focus::after {
  content: '';
  position: absolute;
  bottom: -2.125em;
  left: 0;
  height: 0.2rem;
  width: 100%;
  background: $clr-gradient;
}

.mobile-nav-toggle {
  display: none;
}

@media (max-width: 48rem) {
  .primary-header .btn {
    display: none;
  }
  .nav__link:hover::after,
  .nav__link:focus::after {
    display: none;
  }

  .primary-header {
    padding-block: 1.25rem;
  }

  .primary-navigation {
    flex-direction: column;
    gap: 1.5rem;
    justify-content: center;
    align-items: center;
    padding-block: 2.125rem;
    width: 80vw;
    margin-top: 1rem;
    border-radius: 5px;

    position: fixed;
    background-color: $clr-white;
    right: 10vw;
    left: 10vw;
    top: 4.25rem;

    z-index: 1000;

    transform: translateX(calc(100% + 10vw));
    transition: transform 500ms ease-in-out;

    &.visible {
      transform: translateX(0);
    }
  }

  .mobile-nav-toggle {
    display: block;
    background-image: url('../images/icon-hamburger.svg');
    background-repeat: no-repeat;
    background-position: center;
    width: 1.5rem;
    aspect-ratio: 1;
    border: none;
    background-color: transparent;
    order: 1;
    cursor: pointer;
    &.visible {
      background-image: url('../images/icon-close.svg');
    }
  }

  header.overlay {
    position: relative;
    z-index: 2;

    &::after {
      content: '';
      position: absolute;
      // opacity: 0;
      // display: block;
      // inset: 0;
      width: 100vh;
      height: 100vh;
      background: linear-gradient(to bottom, $clr-primary, transparent);
      z-index: 1;
    }
  }
}

