sources.src\\sass\\components\\_site-header.scss:
@use 'utilities/index' as *;
@use 'layout' as *;
@use 'abstracts' as *;

// TODO check width & flex
.header {
  //  @extend .flex;
  margin-inline: auto;

  z-index: 2;
  // margin-inline: auto;
}

.primary-header {
  @include flex;
  justify-content: space-between;
  align-items: center;
  // padding-block: 1.25rem;
  position: relative;
  grid-area: content;
}

@keyframes fade-in {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

.fade-in {
  animation: fade-in 500ms ease-in-out forwards;
}

